const myImage = new Image();
// png/jpg to base64
myImage.src = "data:image/jpeg;base64,"


myImage.addEventListener('load', function () {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 500;
    canvas.height = 500;

    // 自定义色阶
    const gradient1 = ctx.createLinearGradient(0, 0, canvas.width, canvas.height);
    // const gradient1 = ctx.createLinearGradient(0, 0, canvas.width, 0);
    gradient1.addColorStop(0.2, 'pink');
    gradient1.addColorStop(0.3, 'red');
    gradient1.addColorStop(0.4, 'orange');
    gradient1.addColorStop(0.5, 'yellow');
    gradient1.addColorStop(0.6, 'green');
    gradient1.addColorStop(0.7, 'turquoise');
    gradient1.addColorStop(0.8, 'violet');

    const letters = ['M', 'O', 'B', 'Y'];

    // 切换
    let switcher = true;
    let counter = 0;
    setInterval(() => {
        counter++
        if (counter % 12 === 0) {
            switcher = !switcher;
        }
    }, 500)

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height); // 获取像素数据
    // console.log(pixels);
    ctx.clearRect(0, 0, canvas.width, canvas.height); // 清除后等待重新渲染

    let particlesArray = []; // 创建一组基础粒子
    const numberOfParticles = 5000;

    let mappedImage = []; // 创建一个空数组，用来存放每个像素的像素值

    // 将计算亮度后的像素放入 mappedImage 中
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * pixels.width * 4) + x * 4];
            const green = pixels.data[(y * pixels.width * 4) + x * 4 + 1];
            const blue = pixels.data[(y * pixels.width * 4) + x * 4 + 2];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness, // 亮度
                cellColor = `rgb(${red}, ${green}, ${blue})`, // 颜色   
            ]
            row.push(cell);
        }
        mappedImage.push(row);
    }
    console.log('mappedImage :>> ', mappedImage);

    // 亮度计算
    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114) / 100;
    }

    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            // this.y = Math.random() * canvas.height;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 3.5;
            this.size = Math.random() * 0.1 + 1;

            // 重新定位 mappedImage 
            this.positionY = Math.floor(this.y);
            this.positionX = Math.floor(this.x);
            this.angle = 0;
            this.letter = letters[Math.floor(Math.random() * letters.length)];
            this.random = Math.random();
        }
        draw() {
            ctx.beginPath();
            // 防止超出边界
            if (mappedImage[this.positionY] && mappedImage[this.positionY][this.positionX]) {
                ctx.fillStyle = mappedImage[this.positionY][this.positionX][1]; // 粒子颜色 cellColor
                ctx.strokeStyle = mappedImage[this.positionY][this.positionX][1]; // 粒子颜色 cellColor
            }
            // ctx.fillStyle = gradient1 // 自定义色阶填充
            ctx.font = '20px Arial';
            // ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2, false); // 圆形粒子
            // ctx.strokeRect(this.x, this.y, this.size * 5, this.size * 5); // 矩形粒子
            ctx.fillText(this.letter, this.x, this.y); // 文字粒子

            // 混合粒子形状
            // if (this.random < 0.02) {
            //     ctx.fillText(this.letter, this.x, this.y); // 文字粒子
            // } else {
            //     ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2, false); // 圆形粒子
            // }
            ctx.fill();

        }
        update() {
            this.positionY = Math.floor(this.y);
            this.positionX = Math.floor(this.x);
            // 防止超出边界
            if (mappedImage[this.positionY] && mappedImage[this.positionY][this.positionX]) {
                this.speed = mappedImage[this.positionY][this.positionX][0]; // 根据亮度来控制速度 cellBrightness
            }
            this.movement = (2.5 - this.speed) + this.velocity;
            // this.angle++;
            // this.angle += 0.2; // 旋转风格
            this.angle += this.speed / 20; // 旋转风格
            // this.size = this.speed * 0.5 // 让粒子 在黑暗中更小

            // 周期性切换风格
            // if (switcher) {
            //     ctx.globalCompositeOperation = 'lighten'; // 全局混合模式
            // } else {
            //     ctx.globalCompositeOperation = 'luminosity'; // 全局混合模式
            // }

            if (counter % 10 === 0) {
                // this.x = Math.random() * canvas.width;
                // this.y = Math.random() * canvas.height;
                // this.x = 0
                // this.y = 0;
            }

            // 控制粒子角度, 风格
            // this.y += this.velocity;
            this.y += this.movement + Math.sin(this.angle);
            this.x += this.movement + Math.cos(this.angle) * 3;
            // this.x += this.movement / 4; 
            // 大于canvas高度，重新生成
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            if (this.x >= canvas.width) {
                this.x = 0;
                this.y = Math.random() * canvas.height;
            }
        }
    }

    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle());
        }
    }
    init();
    // console.log(particlesArray);

    function animate() {
        // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.05; // 全局 alpha
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            // ctx.globalAlpha = particlesArray[i].speed / 2;
            ctx.globalAlpha = 1;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate); // 递归动画
    }
    animate()


});
